    false,nt"url": null,nt"notes": "This narrative report for Arctic NWR outlines
    Refuge accomplishments during the 1976 calendar year. The report begins with an
    introduction to the Refuge and information about weather conditions, habitat conditions,
    land acquisition activities, and the system status. Maintenance is also described.
    Habitat management is covered; wilderness areas are discussed. The wildlife section
    of the report discusses endangered and threatened species, migratory birds, mammals,
    non-migratory birds, and grizzly bears, moose, Dall sheep, caribou, polar bears,
    and arctic wolves. Interpretation and recreation activities are outlined; topics
    include information and interpretation, recreation, and law enforcement. Field investigations,
    cooperative programs, items of interest, and safety information are attached.",nt"license_title":
